export function commitRoot(commitQueue, root) {
    console.log('commitRoot', commitQueue, root)
    if (options._commit) options._commit(root, commitQueue);
    const queue = commitQueue
    commitQueue = []
    queue.some(c => {
        try {
            const cbs = c._renderCallbacks
            cbs.some(cb => {
                cb.call(c)
            });
        } catch (e) {
        }
    })
}
